import React from 'react'
import { NavLink } from 'react-router-dom'
import "./index.css";

export default function NavbarC() {
  return (
    <div className='navbarC'>
        <NavLink exact className="active_class" to='/poke'>Pokemon</NavLink>
        <NavLink exact className="active_class" to='/'>Heading</NavLink>
        {/* <br></br>
        <a href='/poke'>Pokemon</a>
        <a href='/'>Heading</a> */}
    </div>
  )
}
